import { Component } from "react";
import Navigation from "../components/Navigation";

class MainLayout extends Component {
  state = {
    showModal: false,
  };

  showModal = () => {
    this.setState({
      ...this.state,
      showModal: !this.state.showModal,
    });
  };

  render() {
    return (
      <>
        <Navigation show={this.showModal} />
        {this.props.children}
      </>
    );
  }
}

export default MainLayout;
